                </div>

                <div className="col" >
                {loading
                    ? (<h4 className="text-danger">Loading...</h4>)
                    : (<h4>All Products</h4>)
                }
                    <div className="row" >
                        {products.map((product) => (
                            <div
                                key={product._id}
                                className="col-md-4"
                            >
                                <AdminProductCard product={product} />
                            </div>
                        ))}
                    </div>

                </div>
            </div>
        </div>
    );
};

